(15, 'Hello Vivek,<br />\r\nPlease join Monet and give your response for this site.<br />\r\n<br />\r\nThanks.', 56, 1310555609, 'hello.vivek.999@gmail.com', 'Vivek Singh'),
(16, 'Hi.  Check out Monet !', 63, 1310563250, 'saumya.kanodia@gmail.com', 'Saumya Agarwal'),
(17, 'Hey Uday,<br />\r\n<br />\r\nPlease join ''Monet'' - an exciting new site to track your feelings..', 64, 1314992236, 'sood.uday@yahoo.com', 'Uday Sood'),
(18, 'Come on!', 65, 1315248548, 'zackalo@haotmail.com', 'Zack Lalani'),
(19, 'Join in!', 65, 1315248661, 'vivaldi.kid@hotmail.com', 'Samir Lalani'),
(20, 'Saad,<br />\r\n<br />\r\nPlease join Monet! Would love to get your help in critiquing this and the UI. Thanks!<br />\r\n<br />\r\nAnurag', 64, 1315800843, 'saad.ahmad03@gmail.com', 'Saad Ahmad'),
(21, 'Raj,<br />\r\nPlease login and add me as your friend and start rating the videos. Would like you and Saurabh to understand different sections for patents and Copyright filings in US. Thanks', 64, 1315894864, 'raj@ashmar.in', 'Raj Kumar'),
(78, 'TEST', 1, 1323322412, 'dinesh.chandra@cynets.com', 'Dinesh Chandra'),
(24, '', 63, 1315930722, 'stavya.agarwal@gmail.com', 'Stavya'),
(25, 'Dear Henry,<br />\r\nThis is an invite to our pre-alpha development tool that has all the concepts we are trying to protect. Please accept the invite. Once I approve it, you will need to login and "add" me as friend, and start rating a few videos, for the "Analytics" to get populated. <br />\r\n<br />\r\nRegards,<br />\r\nAnurag', 64, 1317229873, 'hcittone@cittlind.com', 'Henry Cittone'),
(52, 'LP,<br />\r\nWelcome to Monet! I am sending this to invite you for a very initial trial of Monet. Would welcome your inputs. If you could try it out and have a couple of your researchers try it (please keep this within your group for now as we are trying to maintain confidentiality for IP purposes, and to protect from other potential poachers!), I would greatly appreciate it. In particular it would help if you ''friend'' me and your colleagues at ICT you invite, and help record data. We do need different ethinicities and geneders!<br />\r\nRegards,<br />\r\nAnurag', 64, 1320713854, 'morency@ict.usc.edu', 'Louis-Phillipe Morency'),
(28, 'David,<br />\r\nPlease accept the invite for Monet! You will get a mail with login instructions.<br />\r\nOnce you login, please "friend" me, and start rating a few videos (with capture) - we do need some Caucasian people''s data for our analytics! <br />\r\nRegards,<br />\r\nAnurag', 64, 1319038908, 'drhoffer@gmail.com', 'David Hoffer'),
(47, 'Dave,<br />\r\nWelcome to Monet! This is the trial site we have put on to collect feedback/inputs from friends. Once you accept the admin will approve and send you a mail. Would love to get your feedback!<br />\r\nRegards,<br />\r\nAnurag', 64, 1320338186, 'dave@medlmobile.com', 'Dave Swartz'),
