(53, 'Shri,<br />\r\n<br />\r\nWelcome to Monet! We are ready to do the initial trial and you are the very first users. At this point I would love to see your feedback. I am sending an invite to Panos as well. It would be great if you could ''friend'' us and try different features. Also, if you could record a few videos, that would really help us get different people''s reactions and also get your inputs in what could be improved. We are trying to still keep this in stealth mode, so please keep this within your group!<br />\r\n<br />\r\nLook forward to your feedback.<br />\r\nRegards,<br />\r\nAnurag', 64, 1320714119, 'shri@sipi.usc.edu', 'Shri Narayan'),
(54, 'Panos,<br />\r\n<br />\r\nWelcome to Monet! We are ready to do the initial trial and you are the very first users. At this point I would love to see your feedback. I am sending an invite to Shri as well. It would be great if you could ''friend'' us and try different features. Also, if you could record a few videos, that would really help us get different people''s reactions and also get your inputs in what could be improved. We are trying to still keep this in stealth mode, so please keep this within your group!<br />\r\n<br />\r\nLook forward to your feedback.<br />\r\nRegards,<br />\r\nAnurag', 64, 1320714199, 'georgiou@sipi.usc.edu', 'Panos Georgiou'),
(55, 'Welcome to Monet! Please help us create the next big thing!', 64, 1320881722, 'kaval.lodhie@gmail.com', 'Kaval Lodhie'),
