(57, 'Welcome to Monet! Thanks for coming to the Monet demo at Uday''s place last week. Once you accept this invitation, you will get instructions to login.<br />\r\n<br />\r\nPlease login and start rating videos. Please record with lighting conditions in mind (light facing your face, not the webcam). Feel free to invite your friends. We would welcome your feedback.', 64, 1321137390, 'tracymiller123@gmail.com', 'Tracy Miller'),
