(59, 'Welcome to Monet! Thanks for coming to the Monet demo last week at Uday''s place. Once you ''accept'', you will get an e-mail with instructions to login to Monet. Please login and start rating videos. While recording please keep the lighting conditions in mind (the light should face you, not the webcam!). Feel free to invite your other friends as well. Thanks.', 64, 1321137821, 'juilekaplan4@gmail.com', 'Julie Kaplan'),
